import React from "react";
import styled from "styled-components";
import HomeAccents from "./components/HomeAccents";
const Home = () => {
    return (
        <Component>
            <h1>This is the homepage</h1>
            <HomeAccents />
        </Component>
    );
};
const Component = styled.div`
    position: relative;
    padding-top: 96px;
`;
export default Home;
